import NewsCardss from '../NewsCard/NewsCardss';
const NewsCards = ({newsArticles}) => {
    return (
        <div>
            {newsArticles.map((article,i)=>{
                <NewsCardss key={i}/>
            })}
        </div>
    );
}

export default NewsCards;
